import React from 'react';
import { Link } from 'react-router-dom';
import './styles/main.css';

const Home = () => {
  return (
    <div className="home">
      <section className="hero">
        <h1>Лучшие кроссовки сезона</h1>
        <p>Откройте для себя новую коллекцию</p>
        <Link to="/products" className="cta-button">Смотреть коллекцию</Link>
      </section>
    </div>
  );
};

export default Home;
